import React from 'react'
import {useFetchye} from 'fetchye'

function Joke() {
   const[isLoading, data, error] =  useFetchye('https://v2.jokeapi.dev/joke/Any')

    const jokes = data && data.body

    console.log(jokes)

    if(isLoading) {
        return <div>Loading...</div>
    }
    if(error) {
        return <div>{error.message}</div>
    }



    return (
        <div>
            {jokes && jokes.map(joke => () => <div>{joke.setup}</div>)}
        </div>
    )
}

export default Joke
